import React,{Component} from 'react';
import 'tachyons';
import Nav from './home-container/Nav.js';
import './App.css';
import {
  Switch,
  Route
} from "react-router-dom";
import Home from './home-container/home.js';
import Work from './work-container/work.js';
import Contact from './contact-container/contact.js';

class App extends Component {
  constructor() {
    super();
  this.state={
    route:'home'
  }}

  onRouteChange=(route)=>
{
if(route==='home')
{
  this.setState({route:route});
}else if (route==='work') {
  this.setState({route:route});
}
else if(route==='contact')
{
this.setState({route:route});
}
else {
  this.setState({route:route});
}
}

  render(){
  const{route} = this.state;
    return (
      <div className="app-container">
      <Nav onRouteChange={this.onRouteChange} route={route}/>
      {
        route==='home'?<Home/>:(
            route=='work'?<Work/>:<Contact/>)
      }

    </div>
    );
  }
}

export default App;
